import React from "react";
import { Link } from "react-router-dom";
import Itemfavorite from './Items/Itemfavorite'
import PropTypes from 'prop-types';

function Favorite({products}) {
    return (
        <div class="container" style={{backgroundColor:"#f3f3f3",padding:45+'px'}}>
            <h2 class="header-top header-bottom">My favorite</h2>
            <div class="d-flex flex-row flex-wrap justify-content-center">

            {products.length>0 ? (
                products.map((data)=>(
                <Itemfavorite key={data.id} item={data}/>
                ))
            ):(<h3>No items in favorites</h3>)}
                
            </div>
        </div>
    );
}

Favorite.propTypes = {
    products: PropTypes.array.isRequired
};

export default Favorite;
